import React, { Component } from 'react';
import sky from '.01_Sky.svg';
import './App.css';

class Sky extends Component {
  render() {
    return (
      <div className="App">
        <img src={sky} className="App-logo" alt="logo" />
      </div>
    );
  }
}

export default Sky;
